import React, { Component } from 'react';


class Card extends Component {
    constructor(props) {
        super(props);
        this.state = {
            selected: null
        };
    }

    render() {
        return (
            <div>
                <button value="Search">Search</button>
                <button value="Live">Select From Live</button>
                <button value="Random">Random</button>

            </div>
        );
    }
}

export default Card
